ISLAMABAD, Mar 15 (APP): Nawab of Junagadh State Muhammad Jahangir Khanji and Dewan of the State Sahibzada Sultan Ahmed Ali Monday met with European Union ambassador to Pakistan Androulla Kaminara here.
They deliberated on the matters related to Junagadh State and discussed the way forward.
